import React from 'react';
import './TopBar.css';

const TopBar = () => {
  return (
    <div className="top-bar">
      <h1>Network Performance Dashboard</h1>
      <div className="filters">
        <select>
          <option>Time Range</option>
        </select>
        <select>
          <option>Region</option>
        </select>
        <select>
          <option>ISP</option>
        </select>
        <select>
          <option>Offline Data Sets</option>
        </select>
      </div>
    </div>
  );
};

export default TopBar;
